BrowserRouter as Router,
Routes,
Route,
Switch,
Link,
Redirect
} from "react-router-dom"

import MainPage from './MainPage';
import Register from "./Register";

const xd = " <p> xd </p>";

class App extends Component{
  render(){
    return(
      <Router>
        <Switch>
        <Route exact path ='/' component="<p> xd </p>" />


        </Switch>
      </Router>
      )
  }
}

ReactDOM.render(
    <App />,
  document.getElementById('root')
);
